import React, { Fragment } from "react";
import MainNavbar from "../components/MainNavbar";
import CardComp from "../components/CardComp";
import Footer from "../components/Footer";
import '../css/Index.css';
import { Container } from "react-bootstrap";
import { CardGroup } from "react-bootstrap";

export default function Index() {
    return (
        <Fragment>
            <body>
                <MainNavbar />
                <hr id="hr"></hr>
                <Container id="ContainerMainPage">
                    <CardGroup>
                        <CardComp img="https://bucket-img.tnlmedia.com/cabinet/files/consoles/2/teams/2/2021/9/ykvE14QMdpeEcShwkQr1T5H4IVTHV2dCVsXNCnuG.jpg" />
                        <CardComp img="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/a58a7719-0dcf-4e0b-b7bb-d2b725dbbb8e/denr9lw-2ceb9359-60d1-47f8-975a-802963088d4e.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..tdTbtAz_4gaRAUULq2dHWJM6NnbosnJAyoGDmfQeh0s" />
                        <CardComp img="https://s3-eu-west-1.amazonaws.com/abandomedia/db/poster/db_posters_52111.jpg" />
                        <CardComp img="https://i.pinimg.com/originals/4e/a6/cb/4ea6cbe944924a9bf0599c6076670c42.jpg" />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                    </CardGroup>
                </Container>
                <Footer />
            </body>
        </Fragment>
    );
}
